define('qtype_letterprobe/module', ['jquery'], function ($) {
    return {
        init: function () {
            var result = [];
            var time = 0;
            function getResult()
            {
                var r = {time: time, result: []};
                $(".que .letterprobe tr").each(function (i) {
                    var tds = [];
                    $('td', $(this)).each(function (j) {
                        tds.push($(this).hasClass('check'));
                    })
                    r.result.push(tds);
                });
                return r;
            }

            function updateAnswer()
            {
                var answer = $(".que .answer input").val();
                try {
                    var a = JSON.parse(answer);
                    if(Array.isArray(a.result))
                    {
                        time = a.time;
                        for(var i in a.result)
                        {
                            for (var j in a.result[i])
                            {
                                if(a.result[i][j])
                                {
                                    $($("td", $(".que .letterprobe tr").get(i)).get(j)).addClass('check');
                                } else
                                    $($("td", $(".que .letterprobe tr").get(i)).get(j)).removeClass('check');
                            }
                        }
                    }
                } catch (e) {

                }
            }
            $(".que .letterprobe:not(.readonly) td").click(function () {
                $(this).toggleClass('check');
                result = getResult();
                $(".que .answer input").val(JSON.stringify(result));
            })
            updateAnswer();

            setInterval(function () {
                if(!$(".que .answer input").prop('readonly')) {
                    time++;
                    result = getResult();
                    $(".que .answer input").val(JSON.stringify(result));
                }
            }, 1000);
        }

    };
