define('block_orgs/lib', ['jquery'], function ($) {
    return {
        // settings: {
        //     ajaxurl: M.cfg.wwwroot + "/local/sites/ajax.php",
        // },

        send_ajax: function (ajaxdata, isformdata) {
            var app = this;
            isformdata = typeof isformdata !== 'undefined' ? isformdata : false;
            return new Promise(function (resolve, reject) {
                var params = {
                    url: app.settings.ajaxurl,
                    type: "POST",
                    data: ajaxdata
                };
                if (isformdata) {
                    //см. https://hostenko.com/wpcafe/hacks/ajax-zagruzka-faylov-na-server-s-pomoshhyu-jquery/
                    params.processData = false;
                    params.contentType = false;
                }
                $.ajax(params).done(resolve).fail(reject);
            });
        },

        bool_transform: function (value) {
            var app = this;
            if (value instanceof Object) {
                for (var i in value) {
                    if (value[i] instanceof Object) {
                        app.bool_transform(value[i]);
                    }
                    if (value[i] === false) {
                        value[i] = 0;
                    }
                    if (value[i] === true) {
                        value[i] = 1;
                    }
                }
            }
        },

        show_loader: function (selector, action) {
            selector = typeof selector === 'undefined' ? 'body' : selector;
            var addclass = '';
            var is_body = false;
            if (selector == 'body') {
                addclass = 'fixed';
                is_body = true;
            }
            selector = $(selector);
            action = typeof action === 'undefined' ? 'append' : action;

            var html = '';
            var id = 'loader-' + Math.round(Math.random() * 100000);

            html = `
            <div id="` + id + `" class="sdo-loader-container ` + addclass + `">
                <div class="sdo-loader-block">
                    <div class="sdo-loader"></div>                
                </div>            
            </div>
            `;
            selector[action](html);

            selector.addClass('sdo-loader-parrent');
            var loader = $('#' + id, selector);
            if (!is_body) {
                var width = loader.outerWidth();
                var height = loader.outerHeight();
                width = width >= height ? height : width;
                if (width < 200) {
                    $('.sdo-loader', loader).css('border-width', '8');
                }
                $('.sdo-loader-block', loader).css('width', width / 2).css('height', width / 2);
            }
            loader.on('remove', function () {
                selector.removeClass('sdo-loader-parrent');
            })

            return loader;
        },
