                        method: "start_excel_process",
                        tableid: tableid,
                        perpage: app.params.perpage,
                        page: app.params.page
                    },
                    success: function (data) {
                        $("#excel_download").attr("src", "/blocks/orgs/ajax.php?" +
                            "action="+action+"&" +
                            "method=download_excel&" +
                            "tableid="+tableid+"&" +
                            "filename="+data);
                    }
                });
            });

            $(document).on('change', '#menutable_graphics', function () {
                var graphic = $(this).val();
                app.startLoader();
                $.ajax({
                    url: "/blocks/orgs/ajax.php",
                    data: {
                        action: action,
                        method: "set_graphic",
                        tableid: tableid,
                        graphic: graphic
                    },
                    success: function (data) {
                        app.reloadView(action, true);
                    }
                });
            });
        },

        reloadTables: function (action) {
            var app = this;
            var tableid = $("input[name=tableid]").val();
            $.ajax({
                url: "/blocks/orgs/ajax.php",
                data: {
                    action: action,
                    method: "render_selected_tables",
                    tableid: tableid
                },
                success: function (data) {
                    $(".mdl-tables").html(data);
                    app.initDragDrop(action);
                    app.reloadView(action, true);
                }
            });
        },
        reloadView: function (action, stopLoader = false) {
            var app = this;
            var tableid = $("input[name=tableid]").val();
            $.ajax({
                url: "/blocks/orgs/ajax.php",
                data: {
                    action: action,
                    method: "render_table_view",
                    tableid: tableid,
                    perpage: app.params.perpage,
                    page: app.params.page
                },
                success: function (data) {
                    $(".table-view").html(data);
                    if ($(".groupby-view-wrap").length > 0) {
                        if ($(".groupby-view-wrap").hasClass('hide')) {
                            $(".table-wrap").removeClass('groupmode_open');
                        } else {
                            $(".table-wrap").addClass('groupmode_open');
                        }
                    }
                    $.ajax({
                        url: "/blocks/orgs/ajax.php",
                        data: {
                            action: action,
                            method: "check_select_graph",
                            tableid: tableid
                        },
                        success: function (data) {
                            var sg = $("#menutable_graphics");
                            if (data > 0){
                                $(sg).attr('disabled', false);
                            }else{
                                $(sg).attr('disabled', 'disabled');
                            }
                        }
                    });

                    var graphic = $("#menutable_graphics").val();
                    var myChart = $("#myChart").length;
                    if (graphic && myChart){
                        $.ajax({
                            url: "/blocks/orgs/ajax.php",
                            data: {
                                action: action,
                                method: "get_chart_data",
                                tableid: tableid,
                                json: 1
                            },
                            success: function (data) {
                                if (data.error){
                                    $(".table-view").html(data.error);
                                }else{
                                    app.drawchart(graphic, data.labels, data.datasets);
                                }
                                if (stopLoader){
                                    app.stopLoader();
                                }
                            }
                        });
                    }else{
                        if (stopLoader){
                            app.stopLoader();
                        }
                    }
                },
                error: function (){
                    app.stopLoader();
                },
                timeout: 60000
            });
        },
        reloadGroupby: function (action) {
            var app = this;
            var tableid = $("input[name=tableid]").val();
            $.ajax({
                url: "/blocks/orgs/ajax.php",
                data: {
                    action: action,
                    method: "render_groupby_view",
                    tableid: tableid
                },
                success: function (data) {
                    $(".groupby-view").html(data);
                    app.initDragDrop(action);
                    app.reloadView(action, true);
                    if ($(".groupby-view-wrap").hasClass('hide')){
                        $(".table-wrap").removeClass('groupmode_open');
                    }else{
                        $(".table-wrap").addClass('groupmode_open');
                    }
                }
            });
        },
        initDragDrop: function (action) {
            var app = this;
            var tableid = $("input[name=tableid]").val();

            var checks = $('.table-field:checkbox:checked');
            $(checks).each(function () {
                var p = $(this).parent().parent();
                $(p).draggable({
                    cursor: "move",
                    containment: "document",
                    helper: 'clone'
                });
            });

            $( "#group-stroks" ).droppable({
                drop: function( event, ui ) {
                    var field = ui.draggable[0].outerHTML;
                    var $field = $(field).clone()
                        .find('select,i')
                        .remove()
                        .end()
                        .html();
                    var idnumber = $($field).find('.table-field').attr('idnumber');
                    var idn = $("#group-stroks input[idnumber='"+idnumber+"']").length;
                    if (idn == 0){
                        var orgtableid = $($field).find('.table-field').attr('orgtableid');
                        var fieldname = $($field).find('.table-field').attr('fieldname');
                        $(".group-content", this).append('<div class="group-field">'+$field+'</div>');
                        app.startLoader();
                        $.ajax({
                            url: "/blocks/orgs/ajax.php",
                            data: {
                                action: action,
                                method: "set_groupby",
                                tableid: tableid,
                                orgtableid: orgtableid,
                                fieldname: fieldname,
                                groupby_type: "stroks"
                            },
                            success: function (data) {
                                app.reloadGroupby(action);
                            }
                        });
                    }
                }
            });
            $( "#group-stolbs" ).droppable({
                drop: function( event, ui ) {
                    var field = ui.draggable[0].outerHTML;
                    var $field = $(field).clone()
                        .find('select,i')
                        .remove()
                        .end()
                        .html();
                    var idnumber = $($field).find('.table-field').attr('idnumber');
                    var idn = $("#group-stolbs input[idnumber='"+idnumber+"']").length;
                    if (idn == 0){
                        var orgtableid = $($field).find('.table-field').attr('orgtableid');
                        var fieldname = $($field).find('.table-field').attr('fieldname');
                        $(".group-content", this).append('<div class="group-field">'+$field+'</div>');
                        app.startLoader();
                        $.ajax({
                            url: "/blocks/orgs/ajax.php",
                            data: {
                                action: action,
                                method: "set_groupby",
                                tableid: tableid,
                                orgtableid: orgtableid,
                                fieldname: fieldname,
                                groupby_type: "stolbs"
                            },
                            success: function (data) {
                                app.reloadGroupby(action);
                            }
                        });
                    }
                }
            });
        },

        drawchart: function($type, $labels, $datasets){
            var ctx = document.getElementById("myChart").getContext('2d');
            var myChart = new Chart(ctx, {
                type: $type,
                data: {
                    labels: $labels,
                    datasets: $datasets
                },
                options: {responsive: true}
            });
            var app = this;
            app.stopLoader();
        },
        startLoader: function () {
            $(".analytics-table-ajax").css({'display': 'flex'});
        },
        stopLoader: function () {
            $(".analytics-table-ajax").hide();
        }

    };
});
